import React, { useState } from 'react';
import { Document, Page, pdfjs } from 'react-pdf';

// Set up PDF.js worker
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.min.js`;

const MinimalPDFRenderer = ({ file }) => {
  const [numPages, setNumPages] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const handleLoadSuccess = ({ numPages }) => {
    console.log('MinimalPDFRenderer: PDF loaded successfully with', numPages, 'pages');
    setNumPages(numPages);
    setLoading(false);
    setError(null);
  };

  const handleLoadError = (error) => {
    console.error('MinimalPDFRenderer: PDF load error:', error);
    setError(`Failed to load PDF: ${error.message || 'Unknown error'}`);
    setLoading(false);
  };

  const handlePageRenderSuccess = (pageNum, page) => {
    console.log(`MinimalPDFRenderer: Page ${pageNum} rendered successfully`);
    const { width, height } = page.getViewport({ scale: 0.5 });
    console.log(`MinimalPDFRenderer: Page ${pageNum} dimensions:`, { width, height });
  };

  const handlePageRenderError = (error, pageNumber) => {
    console.error(`MinimalPDFRenderer: Error rendering page ${pageNumber}:`, error);
  };

  if (!file) {
    return <div className="p-4 text-gray-500">No file provided</div>;
  }

  return (
    <div className="border-2 border-blue-500 p-4 bg-blue-50">
      <h3 className="font-bold text-blue-800 mb-2">Minimal PDF Renderer</h3>
      
      {loading && (
        <div className="text-center p-4">
          <div className="animate-spin rounded-full h-6 w-6 border-b-2 border-blue-600 mx-auto mb-2"></div>
          <p className="text-sm">Loading PDF...</p>
        </div>
      )}

      {error && (
        <div className="text-red-500 p-2 border border-red-200 rounded text-sm">
          <p><strong>Error:</strong> {error}</p>
        </div>
      )}

      {numPages && (
        <div className="text-green-600 p-2 border border-green-200 rounded text-sm">
          <p><strong>Success!</strong> Loaded {numPages} pages.</p>
        </div>
      )}

      <div className="mt-2">
        <Document
          file={file}
          onLoadSuccess={handleLoadSuccess}
          onLoadError={handleLoadError}
          loading={<div className="text-sm">Loading...</div>}
          error={<div className="text-sm text-red-500">Error loading PDF</div>}
        >
          {numPages && Array.from(new Array(numPages), (el, idx) => (
            <div key={idx} className="mb-4">
              <h4 className="text-sm font-medium mb-1">Page {idx + 1}</h4>
              <Page 
                pageNumber={idx + 1} 
                scale={0.5}
                loading={<div className="text-sm">Loading page...</div>}
                error={<div className="text-sm text-red-500">Error loading page</div>}
                onRenderSuccess={(page) => handlePageRenderSuccess(idx + 1, page)}
                onRenderError={(error) => handlePageRenderError(error, idx + 1)}
              />
            </div>
          ))}
        </Document>
      </div>

      <div className="mt-2 text-xs text-gray-500">
        <div>File type: {typeof file}</div>
        <div>Is Blob: {file instanceof Blob ? 'Yes' : 'No'}</div>
        <div>Size: {file.size || 'Unknown'} bytes</div>
        <div>PDF.js version: {pdfjs.version}</div>
        <div>Worker: {pdfjs.GlobalWorkerOptions.workerSrc}</div>
      </div>
    </div>
  );
};

export default MinimalPDFRenderer;
